import React from 'react';

const HomeTab = ({ theme }) => {
  return (
    <div className={`card p-3 ${theme.card}`}>
      <h2 className={theme.accentText}>Welcome to the Bible App</h2>
      <p className={theme.subtleText}>Start exploring verses and finding inspiration!</p>
    </div>
  );
};

export default HomeTab;
